export default{
	data() {
		return {

		}
	},
	props:{
		page_total:{
			type:[Number,String],
			default:30
		},
		current_page:{
			type:[Number,String],
			default:1
		}
		
	},
	computed: {
	  page: {
		get () {
		  return this.current_page
		},
		set (val) {
			this.$emit('changePage',val);
		}
	  },
	},
	methods:{
		watchInput(val){
			let data = Number(val.target.value);
			if(typeof(data)=='number'){
				if(data!=this.page){
					this.page = data<=this.page_total?data:this.page_total;
				}
			}else{
				this.page = 1;
			}
		}
	}

}
